import "./GroupComponent3.css";

const GroupComponent3 = () => {
  return (
    <div className="ellipse-root">
      <img className="group-item" alt="" src="../ellipse-1.svg" />
      <img className="group-inner" alt="" src="../ellipse-2.svg" />
      <img className="ellipse-icon" alt="" src="../ellipse-31.svg" />
    </div>
  );
};

export default GroupComponent3;
